package io.konig.jsonschema.generator;

public class JsonSchemaGeneratorException extends Exception {
	private static final long serialVersionUID = 1L;

	public JsonSchemaGeneratorException() {
		// TODO Auto-generated constructor stub
	}

	public JsonSchemaGeneratorException(String msg) {
		super(msg);
	}

	public JsonSchemaGeneratorException(Throwable cause) {
		super(cause);
	}

	public JsonSchemaGeneratorException(String msg, Throwable cause) {
		super(msg, cause);
	}

}
